import React from "react";

function Cards(props) {
    return (
      <div className="info">
        <div className="card">
          <div className="top">
            <h2 className="name">{props.name}</h2>
            <Avatar />
          </div>
          <div className="bottom">
            <p>{props.phone}</p>
            <p>{props.email}</p>
          </div>
        </div>
      </div>
    );
  }

  export default Cards;
